import React , {useState ,useEffect} from 'react'
import { Typography , Divider, Row,Col, Modal,Collapse } from 'antd';
import { useSelector } from 'react-redux';
import Fade from 'react-reveal/Fade'
import axios from 'axios';


const { Title, Paragraph , Text} = Typography;

const CourseContents = () => {
    const user = useSelector((state) => state.user);
    const [Courses, setCourses] = useState([])
    const [loading, setLoading] = useState(false)

    const getCheck = () =>{
        setLoading(true)
        let body = {
            userId: user.userData.studentId
        }
        axios.post("/api/datas/check",body).then((response) => {
        if (response.data.success) {
          setCourses([...response.data.checkList]);
          console.log(response.data.checkList)
          setLoading(false)
        } else {
          alert("수업 정보를 가져오는데 실패했습니다.");
        }
      });
    }
    return (
        <Fade>
        <div className='contents'>
            <Title level={5}>수업 확인</Title>
            <Row justify='center'>
                <p>출첵확인</p>
                <Col>

                </Col>
            </Row>
        </div>
        </Fade>
    )
}

export default CourseContents
